Require Import coq.
Require Import theory_hol.
Require Import hol_types.
Require Import hol_type_abbrevs.
Require Import hol_terms.
Definition term1 (a0 : Type') (a1 : Type') (a2 : Type') (a3 : Type') (a4 : Type') (a5 : Type') (a6 : Type') (a7 : Type') (a8 : Type') := (forall y0 : a1 -> Prop, forall y1 : type1470 a0 a1, (@UNIONS a0 (@GSPEC (a0 -> Prop) (fun y2 : a0 -> Prop => exists y3 : a1, @SETSPEC (a0 -> Prop) y2 (y0 y3) (y1 y3)))) = (@GSPEC a0 (fun y2 : a0 => exists y3 : a0, @SETSPEC a0 y2 (exists y4 : a1, (y0 y4) /\ (@IN a0 y3 (y1 y4))) y3))) /\ ((forall y0 : type1470 a3 a4, forall y1 : type1517 a2 a3 a4, (@UNIONS a2 (@GSPEC (a2 -> Prop) (fun y2 : a2 -> Prop => exists y3 : a4, exists y4 : a3, @SETSPEC (a2 -> Prop) y2 (y0 y3 y4) (y1 y3 y4)))) = (@GSPEC a2 (fun y2 : a2 => exists y3 : a2, @SETSPEC a2 y2 (exists y4 : a4, exists y5 : a3, (y0 y4 y5) /\ (@IN a2 y3 (y1 y4 y5))) y3))) /\ (forall y0 : type1517 a6 a7 a8, forall y1 : type1524 a5 a6 a7 a8, (@UNIONS a5 (@GSPEC (a5 -> Prop) (fun y2 : a5 -> Prop => exists y3 : a8, exists y4 : a7, exists y5 : a6, @SETSPEC (a5 -> Prop) y2 (y0 y3 y4 y5) (y1 y3 y4 y5)))) = (@GSPEC a5 (fun y2 : a5 => exists y3 : a5, @SETSPEC a5 y2 (exists y4 : a8, exists y5 : a7, exists y6 : a6, (y0 y4 y5 y6) /\ (@IN a5 y3 (y1 y4 y5 y6))) y3)))).
Definition term0 (a0 : Type') (a1 : Type') := forall y0 : a1 -> Prop, forall y1 : type1470 a0 a1, (@UNIONS a0 (@GSPEC (a0 -> Prop) (fun y2 : a0 -> Prop => exists y3 : a1, @SETSPEC (a0 -> Prop) y2 (y0 y3) (y1 y3)))) = (@GSPEC a0 (fun y2 : a0 => exists y3 : a0, @SETSPEC a0 y2 (exists y4 : a1, (y0 y4) /\ (@IN a0 y3 (y1 y4))) y3)).
